    associated attributes created in accordance with the "Federal Guidelines, Requirements,
    and Procedures for the National Watershed Boundary data set; Chapter 3 of Section
    A, Federal Standards, Book 11, Collection and Delineation of Spatial Data; Techniques
    and Methods 11-A3" (04/01/2009). http://www.ncgc.nrcs.usda.gov/products/data sets/watershed/index.html
